import React from "react";

const Menu = () => {
  const newsLinks = [
    {
      title: "",
      url: "noticias/noticia1",
    },
    {
      title: "Noticia 2",
      url: "noticias/noticia1",
    },
    {
      title: "Noticia 3",
      url: "noticias/noticia1",
    },
  ];

  return (
    <div className="menu">
      <h2>Men√∫ de Noticias</h2>
      <ul>
        {newsLinks.map((link, index) => (
          <li key={index}>
            <a href={link.url} target="_blank" rel="noopener noreferrer">
              {link.title}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Menu;
